import React, { useState } from 'react';
import AdminNavBar from '../components/AdminNavBar';

function AdminDashboard() {
  const [activeSection, setActiveSection] = useState('add-product');

  const renderContent = () => {
    switch (activeSection) {
      case 'add-product':
        return (
          <div>
            <h3>Add Product</h3>
            {/* Placeholder for Add Product Form */}
            <form style={{ display: 'flex', flexDirection: 'column', gap: '10px', maxWidth: '500px' }}>
              <input type="text" placeholder="Product Name" required />
              <textarea placeholder="Description" />
              <input type="text" placeholder="Brand" required />
              <input type="number" placeholder="Price" required />
              <input type="text" placeholder="Category" required />
              <input type="file" accept="image/*" />
              <button className="button" type="submit">Add Product</button>
            </form>
          </div>
        );
      case 'update-product':
        return (
          <div>
            <h3>Update Product</h3>
            {/* Placeholder for Update Product Form */}
            <form style={{ display: 'flex', flexDirection: 'column', gap: '10px', maxWidth: '500px' }}>
              <input type="text" placeholder="Current Product Name" required />
              <input type="text" placeholder="New Product Name" />
              <textarea placeholder="New Description" />
              <input type="text" placeholder="New Brand" />
              <input type="number" placeholder="New Price" />
              <input type="text" placeholder="New Category" />
              <input type="file" accept="image/*" />
              <button className="button" type="submit">Update Product</button>
            </form>
          </div>
        );
      case 'remove-product':
        return (
          <div>
            <h3>Remove Product</h3>
            {/* Placeholder for Remove Product */}
            <form style={{ display: 'flex', flexDirection: 'column', gap: '10px', maxWidth: '500px' }}>
              <input type="text" placeholder="Product Name" required />
              <button className="button" type="submit" style={{ backgroundColor: '#ff3f6c' }}>Remove Product</button>
            </form>
          </div>
        );
      case 'access-users':
        return (
          <div>
            <h3>Access Users</h3>
            <p>Placeholder for user management (list, edit, delete users).</p>
          </div>
        );
      case 'user-orders':
        return (
          <div>
            <h3>User Orders</h3>
            <p>Placeholder for viewing and managing user orders.</p>
          </div>
        );
      default:
        return null;
    }
  };

  return (
    <div>
      <AdminNavBar />
      <div style={{ display: 'flex', minHeight: '100vh' }}>
        {/* Sidebar */}
        <div style={{
          width: '250px',
          backgroundColor: '#f5f5f5',
          padding: '20px',
          boxShadow: '2px 0 5px rgba(0,0,0,0.1)'
        }}>
          <h3>Admin Panel</h3>
          <ul style={{ listStyle: 'none', padding: 0 }}>
            <li>
              <button
                onClick={() => setActiveSection('add-product')}
                style={{
                  width: '100%',
                  padding: '10px',
                  textAlign: 'left',
                  background: activeSection === 'add-product' ? '#ff3f6c' : 'none',
                  color: activeSection === 'add-product' ? '#fff' : '#333',
                  border: 'none',
                  cursor: 'pointer',
                  marginBottom: '5px'
                }}
              >
                Add Product
              </button>
            </li>
            <li>
              <button
                onClick={() => setActiveSection('update-product')}
                style={{
                  width: '100%',
                  padding: '10px',
                  textAlign: 'left',
                  background: activeSection === 'update-product' ? '#ff3f6c' : 'none',
                  color: activeSection === 'update-product' ? '#fff' : '#333',
                  border: 'none',
                  cursor: 'pointer',
                  marginBottom: '5px'
                }}
              >
                Update Product
              </button>
            </li>
            <li>
              <button
                onClick={() => setActiveSection('remove-product')}
                style={{
                  width: '100%',
                  padding: '10px',
                  textAlign: 'left',
                  background: activeSection === 'remove-product' ? '#ff3f6c' : 'none',
                  color: activeSection === 'remove-product' ? '#fff' : '#333',
                  border: 'none',
                  cursor: 'pointer',
                  marginBottom: '5px'
                }}
              >
                Remove Product
              </button>
            </li>
            <li>
              <button
                onClick={() => setActiveSection('access-users')}
                style={{
                  width: '100%',
                  padding: '10px',
                  textAlign: 'left',
                  background: activeSection === 'access-users' ? '#ff3f6c' : 'none',
                  color: activeSection === 'access-users' ? '#fff' : '#333',
                  border: 'none',
                  cursor: 'pointer',
                  marginBottom: '5px'
                }}
              >
                Access Users
              </button>
            </li>
            <li>
              <button
                onClick={() => setActiveSection('user-orders')}
                style={{
                  width: '100%',
                  padding: '10px',
                  textAlign: 'left',
                  background: activeSection === 'user-orders' ? '#ff3f6c' : 'none',
                  color: activeSection === 'user-orders' ? '#fff' : '#333',
                  border: 'none',
                  cursor: 'pointer'
                }}
              >
                User Orders
              </button>
            </li>
          </ul>
        </div>
        {/* Main Content */}
        <div style={{ flex: 1, padding: '20px' }}>
          {renderContent()}
        </div>
      </div>
    </div>
  );
}

export default AdminDashboard;
